import React from 'react';
import { MDBNavbar, MDBContainer, MDBNavbarBrand, MDBNavbarNav, MDBNavbarItem, MDBBtn } from 'mdb-react-ui-kit';
import { useNavigate } from 'react-router-dom';
import { useAuth } from '../context/AuthContext.tsx';

const AdminNavBar: React.FC<{ username: string }> = ({ username }) => {
  const navigate = useNavigate();
  const { logout } = useAuth();

  const handleLogout = () => {
    logout();
    navigate('/');
  };

  return (
    <MDBNavbar expand='lg' light bgColor='light' className='mb-4'>
      <MDBContainer fluid>
        <MDBNavbarBrand style={{ cursor: 'pointer' }} onClick={() => navigate('/admin')}>Wamflow Admin</MDBNavbarBrand>
        <MDBNavbarNav className='d-flex flex-row gap-3'>
          <MDBNavbarItem>
            <MDBBtn color='link' onClick={() => navigate('/admin')}>Home</MDBBtn>
          </MDBNavbarItem>
          <MDBNavbarItem>
            <MDBBtn color='link' onClick={() => navigate('/admin-submit')}>Submit Bias</MDBBtn>
          </MDBNavbarItem>
          <MDBNavbarItem>
            <MDBBtn color='link' onClick={() => navigate('/search')}>Search Bias</MDBBtn>
          </MDBNavbarItem>
          <MDBNavbarItem>
            <MDBBtn color='link' onClick={() => navigate('/user-list')}>User List</MDBBtn>
          </MDBNavbarItem>
          <MDBNavbarItem>
            <MDBBtn color='link' onClick={() => navigate('/update-bias')}>Update Bias</MDBBtn>
          </MDBNavbarItem>
          <MDBNavbarItem>
            <MDBBtn color='danger' onClick={handleLogout}>Logout</MDBBtn>
          </MDBNavbarItem>
        </MDBNavbarNav>
      </MDBContainer>
    </MDBNavbar>
  );
};

export default AdminNavBar;
